import React from "react";
import { Container, Input, Item, Left, Right } from "./contextNav";
import { RiYoutubeFill } from "react-icons/ri";

const ContextNavbar = () => {
  return (
    <Container>
      <Left>
        <RiYoutubeFill />
        <>YouTube </>
      </Left>
      <Right>
        <Input type="text" />
        <Item>Home</Item>
        <Item>Count </Item>
      </Right>
    </Container>
  );
};

export default ContextNavbar;
